import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';

const Profile = ()=>{
    return(
        <View style={styles.root}>
            <LinearGradient 
            colors={["#003ff","#6bc1ff"]}
            style={{height:"20%"}}
            />
        </View>
    )
} 
const styles = StyleSheet.create({
    root:{
        flex:1
    }
})

export default Profile
